-- Seed LISTE.pdf reference data (marques, categories, modeles, pays, vendeurs).
-- This file is generated from LISTE.pdf parsing.

CREATE TABLE IF NOT EXISTS liste_reference (
  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),
  marque text,
  modele text,
  gamme text,
  pays text,
  vendeur text,
  src text,
  statut text,
  niveau_priorite text,
  statut_logistique text,
  created_at timestamptz DEFAULT now()
);

ALTER TABLE liste_reference ENABLE ROW LEVEL SECURITY;

DROP POLICY IF EXISTS "Liste reference read" ON liste_reference;
CREATE POLICY "Liste reference read"
  ON liste_reference
  FOR SELECT
  TO authenticated
  USING (true);

CREATE TABLE IF NOT EXISTS pays_reference (
  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),
  code text UNIQUE NOT NULL,
  nom text NOT NULL,
  actif boolean DEFAULT true,
  created_at timestamptz DEFAULT now()
);

ALTER TABLE pays_reference ENABLE ROW LEVEL SECURITY;

DROP POLICY IF EXISTS "Pays reference read" ON pays_reference;
CREATE POLICY "Pays reference read"
  ON pays_reference
  FOR SELECT
  TO authenticated
  USING (true);

CREATE TABLE IF NOT EXISTS vendeurs_reference (
  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),
  code text UNIQUE NOT NULL,
  nom text NOT NULL,
  actif boolean DEFAULT true,
  created_at timestamptz DEFAULT now()
);

ALTER TABLE vendeurs_reference ENABLE ROW LEVEL SECURITY;

DROP POLICY IF EXISTS "Vendeurs reference read" ON vendeurs_reference;
CREATE POLICY "Vendeurs reference read"
  ON vendeurs_reference
  FOR SELECT
  TO authenticated
  USING (true);

