INSERT INTO modeles_produits (marque_id, categorie_id, code_modele, nom_complet)
SELECT m.id, c.id, v.code_modele, v.nom_complet
FROM modeles_source v
JOIN marques m ON m.code = v.marque_code
LEFT JOIN categories_produits c ON c.marque_id = m.id AND c.code = v.categorie_code
ON CONFLICT (marque_id, code_modele) DO NOTHING;

